class GameRepository(private val myDb:AppDatabase) {

    suspend fun checkAndInsert(context: Context){
        if(myDb.gameDao().getCount() == 0) {
            addVeryEasy()
            addEasy()
            addMedium()
            addHard()
            addWeeklyGame()
            DataStoreManager(context).updateArrows(5)
            DataStoreManager(context).updateBombs(5)
            DataStoreManager(context).updateHints(5)
            }
    }

    // game manipulating
    suspend fun saveGame(game:Game){
        myDb.gameDao().update(game)
    }
    suspend fun saveWeeklyGame(game: WeeklyGame){
        myDb.weeklyGameDao().update(game)
    }
    fun getGameByLevel(level:Int): Flow<List<Game>> {
        return myDb.gameDao().getGamesByLevel(level)
    }

    //history manipulating
    suspend fun insertHistory(game: Game){
        val myDate = Calendar.getInstance().time
        val formatter = SimpleDateFormat("yyyy/MM/dd")
        val formatDate = formatter.format(myDate)
        val gameHistory = GameHistory(0,game.level,game.id,game.totalTimes,formatDate)
        myDb.gameHistoryDao().insertGame(gameHistory)
    }
    fun getGameHistoryByLevel(level:Int):Flow<List<GameHistory>>{
        return myDb.gameHistoryDao().findByLevel(level)
    }
    suspend fun deleteHistory(gameHistory: GameHistory){
        myDb.gameHistoryDao().deleteGameHIstory(gameHistory)
    }
    suspend fun clearAllHistory(){
        myDb.gameHistoryDao().deleteAll()
    }

    // weekly data manupulating
    suspend fun getWeekGame(week: Int): Game {
        Log.i("This week", week.toString())
        val weeklyGame = myDb.weeklyGameDao().getGamesById(Utility.getWeek())
        return weeklyGame?.let { Game(weeklyGame.id, 0, it.totalTimes, weeklyGame.quiz, weeklyGame.currentState, weeklyGame.solution) }
    }
